import React from 'react';

const ServiceList = ({ services, onDeleteService }) => {
  return (
    <div>
      <h2 className="text-xl font-bold mb-2">Service List</h2>
      <ul>
        {services.map(service => (
          <li key={service.id} className="mb-4">
            <div className="border p-4 rounded shadow">
              <h3 className="font-bold text-lg">{service.name}</h3>
              <p className="text-gray-600">Category: {service.category}</p>
              <p className="text-gray-600">Rating: {service.rating}</p>
              <button
                onClick={() => onDeleteService(service.id)}
                className="mt-2 bg-red-500 hover:bg-red-600 text-white font-bold py-2 px-4 rounded"
              >
                Delete
              </button>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ServiceList;
